Par is a multi-layer language with an intermediate representation in itself. A simple program like type HW = either { .hello_world! } def main: HW = .hello_world! is compiled to a program fully written in process syntax : ?type HW = either { .hello_world! }
?
def main: HW = chan user { user.hello_world user!
} Par is centered around concurrency and session typing, all in the framework of linear logic. What does that mean? Types are linear , i.e. a value must be used exactly once. You might know the type system of Rust, where a value must be used at most once. Ultimately, everything in Par is a channel . A list sends every item in order and then closes A function receives its argument and becomes the result An infinite stream can be signaled to either yield the next item or close Channels communicate with each other by sending signals (the names with a dot in front) sending values closing each other Everything has a dual in Par: A value can be created by destroying its dual (see channel expressions ) This can all be abstracted away in expressions and types or be exposed as statements in process syntax . Putting all of this together, Par manages to be a functional language while also allowing imperative-style code and mutability. For example, a mutable stack can be implemented like this ( explanation ): ?type Bool = either { .true!, .false! }
?type List<T> = recursive either { .empty!, .item(T) self }
?type Option<T> = either { .none!, .some T }
?
type Stack<Unwrap, T> = iterative { .push(T) => self .pop => (Option<T>) self .unwrap => Unwrap
} dec list_stack : [type T] [List<T>] Stack<List<T>, T>
def list_stack = [type T] [list] begin { .push(x) => let list: List<T> = .item(x) list in loop .pop => list { .empty! => (.none!) let list: List<T> = .empty! in loop, .item(head) tail => (.some head) let list = tail in loop } .unwrap => list
} def main = do { let list: List<Bool> = .empty! let stack = list_stack(type Bool)(list) // stack currently represents an empty list // the following operations mutate stack stack.push(.true!) // stack now represents a singleton of .true! stack.push(.false!) // stack now represents a two-element list
} in stack Running this in the playground you can push and pop elements, or inspect the underlying data using unwrap. For a complete tutorial, see the Readme

